  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0133632 includes physical,
  profile and underway data collected aboard the ROGER REVELLE during cruise RR1501
  in the Tasman Sea from 2015-01-09 to 2015-02-03. These data include CONDUCTIVITY,
  CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
  SALINITY and WATER TEMPERATURE. The instruments used to collect these data include
  ADCP, CTD and GPS. These data were collected by Matthew Alford of University of
  California - San Diego; Scripps Institution of Oceanography as part of The role
  of internal wave-driven near-bed turbulent dynamics in coastal ocean sediment mobilisation.
  The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NCEI as part
  of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
  the raw and automated processed data set. Post processed quality assessed data are
  not available in this accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
